\c test

create table person (
	id BIGSERIAL NOT NULL PRIMARY KEY,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	gender VARCHAR(7),
	email VARCHAR(150),
	date_of_birth DATE,
	country_of_birth VARCHAR(50)
);
